// Dropdown.js
import React from 'react';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import { NavLink } from 'react-router-dom';

const Dropdown = ({ selectedItem, onSelectItem }) => {
  return (
    <div className="w-screen h-12 bg-primary p-2 text-white font-semibold text-lg flex flex-row space-x-2">
      <NavLink to="/">About</NavLink>
      <h1>{'>'}</h1>
      <button onClick={onSelectItem}>{selectedItem}</button>
      <Menu
        id="basic-menu"
        anchorEl={null}
        open={false}
        onClose={() => {}}
        MenuListProps={{
          'aria-labelledby': 'basic-button',
        }}
      >
        <MenuItem onClick={() => onSelectItem('Affiliation')}>
          <NavLink to="/affiliation">Affiliation</NavLink>
        </MenuItem>
        <MenuItem onClick={() => onSelectItem('Suvo Chaterjee')}>
          <NavLink to="/suvo">Suvo Chaterjee</NavLink>
        </MenuItem>
        <MenuItem onClick={() => onSelectItem('Contact Us')}>
          <NavLink to="/contact">Contact Us</NavLink>
        </MenuItem>
      </Menu>
    </div>
  );
};

export default Dropdown;
